import Layout from "../comps/Layout";
import Section from "../comps/Section";
const Index = () => (
  <Layout>
    <Section col={"7"} uno={true}>
      {" "}
    </Section>
    <Section col={"5"}></Section>
  </Layout>
);

export default Index;
